export const ADD_PRODUCT = "ADD_PRODUCT";
export const DELETE_PRODUCT = "DELETE_PRODUCT";

export const deleteProduct = (productCode) => {
    return {
        type: DELETE_PRODUCT,
        productCode
    }
}

export const addProduct = (product) => {
    return {
        type: ADD_PRODUCT,
        product
    }
}
